import React from 'react';
import {connect} from 'react-redux';
import * as actionCreator from '../Store/ActionCreators/DeploymentActions';

class Deployments extends React.Component
{
    constructor ()
    {
       super();
       this.handleClickIndex = this.handleClickIndex.bind(this)
    }

    render()
    {

        return(
            <div>
                <ul style={{listStyleType:"none"}}>
                  { (this.props.Delployments||[]).map((Delployment,index)=><li key={Delployment._id}>{Delployment.templateName} <button name="removeTask" onClick={event=>this.props.handleClickIndex(Delployment._id)}>x</button></li>)}
                </ul>
            </div>
        )
    }


}

const mapStateToProps= (state) => 
   {
        return {
            Delployments:state.Delployments
        }
  }

  const mapDispatchToProps = (dispatch,Ownprops) => {
        return {
            LoadDeployment : ()=> dispatch(actionCreator.LoadDeployment()),
            handleClickIndex : (DepID)=> dispatch(actionCreator.RemoveDeployment(DepID))
        }
 
  }


export default connect(mapStateToProps,mapDispatchToProps)(Deployments);
